WorkItem.Description:
The following code creates the error:
"Supplied parameters do not match any signature of call target: Type '{ de: string; 'en-US': string; fr: string; }' is missing property ''en-US'' from type 'Translation'."
```
interface Translation {
	de: string;
	'en-US': string;
	fr: string;
}
var translations: Translation[] = [];
translations.push({de: 'de', 'en-US': 'en', fr: 'fr'});
```
But the object has the property "en-US".
